import { Link, useNavigate } from 'react-router-dom';
import "./Navbar.modules.css";
import logo from '../../img/logo.png'
import Globais from '../Globais';
import React from 'react';
import NovaConta from '../NovaConta';

function Navbar() {
    const navigate = useNavigate();

    const logout = () => {
        localStorage.setItem("login", 0);
        //localStorage.setItem("id", 0);
    }

    const navegarPerfil = () => {
        navigate("/feed");
    }

    return (
        <div className='headerMenu'>
           {/** <nav className="navMenu">*/} 
                <div className="logoMenu">
                   <button className="button" onClick={navegarPerfil}> <img src={logo} /> </button>
                </div>
                <div className="searchMenu">
                <img src='https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.iconfinder.com%2Ficons%2F309077%2Fsearch_icon&psig=AOvVaw3TNpHoZxn9PFsp2VKwxCen&ust=1665726543669000&source=images&cd=vfe&ved=0CAwQjRxqFwoTCPjZ-YjB3PoCFQAAAAAdAAAAABAE' alt="..." width="150px" className="searchIcon" />
                    <p>Busque na Fybs...</p>
                </div>
                <div className="exit">
                <ul className="list">
                <li className="item">
                    <Link to="/feed">Feed</Link>
                </li>
                <li className="item">
                    <Link to="/perfil">Perfil</Link>
                </li>
                <li className="item">
                    <Link to="/grupos/lol">Grupos</Link>
                </li>
                <li className="item">
                    <Link to="/" onClick={logout}>Logout</Link>
                </li>
            </ul>

                </div>
            {/**</nav>*/}
        </div>
    );
}

export default Navbar;
